import React, { useContext,useEffect,useState } from 'react'
import carlist from '../Assets/images/carlist.png'
import ac from '../Assets/images/ac.png'
import seat from '../Assets/images/seat.png'
import manual from '../Assets/images/manual.png'
import Navbar from '../Components/Navbar';
import Footer from '../Components/Footer';
import { MyContext } from '../Components/SearchCarBox'
import $ from 'jquery'
import { useLocation } from 'react-router-dom'
import axios from 'axios'
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
const ListingPage = () => {

  $(document).ready(function(){
    $(".search_edit_edit").click(function(){
     $(".search-edit").toggleclassName("show_search");
    });
    $(".filter-phone").click(function(){
     $(".Listing_sidebar").toggleclassName("show_filter");
    });
  });
  useEffect(() => {
    
    getData() 
 }, [])
 const date = new Date();
  const location=useLocation()
  
    const { REACT_APP_SERVER_URL } = process.env;
    const [fromTime, setFromTime] = useState(location.state.fromTime);
    const [toTime, settoTime] = useState(location.state.toTime); 
    const [selectcity, setselectcity] = useState(location.state.selectcity);
    const [selectlocation, setselectlocation] = useState(location.state.selectlocation);
    const [sortByLowToHigh, setSortByLowToHigh] = useState(false);
    const [sortByHighToLow, setSortByHighToLow] = useState(false);
    // console.log(location.state.fromDateformate,'kkkkkkkkkkkkkkkkkkk');
    const [startDate,setStartDate]=useState(location.state.fromDate)
    const [endDate,setEndDate]=useState(location.state.toDate)

    const [category, setcategory] = useState([]);
    const [maker, setmaker] = useState([]);
    const [today, setToday] = useState(new Date());
    const tomorrow = new Date(today);
    tomorrow.setDate(tomorrow.getDate() + 1);

     const [list, setlist] = useState([])
    
    
    const handleFromDateChange = (date) => {
      console.log(date,'from date');
      setStartDate(date);
      setEndDate(null); // reset to date when from date changes
      const tomorrow = new Date(date);
    tomorrow.setDate(tomorrow.getDate() + 1);
    console.log(tomorrow,'lala');
    };
    const handleToDateChange = (date) => {
      setEndDate(date);
      console.log(date,'to date');
      
    };
    const handleFromTime=(event)=>{
      setFromTime((event.target.value))
      console.log(event.target.value,'from time');
    }
    const handleToTime=(event)=>{
      settoTime((event.target.value))
      console.log(event.target.value,'to time');
    }
   
    const getData=async()=>{
      let Day1 = String(startDate.getDate()).padStart(2, '0');
      let Month1 = String(startDate.getMonth() + 1).padStart(2, '0');
      let Year1 = new Date(startDate).getFullYear();
      let date1 = `${Year1}-${Month1}-${Day1}`
      
      let Day2 = String(endDate.getDate()).padStart(2, '0');
      let Month2 = String(endDate.getMonth() + 1).padStart(2, '0');
      let Year2 = new Date(endDate).getFullYear();
      let date2=`${Year2}-${Month2}-${Day2}`
      // console.log(Year2,"-",Month2,"-",Day2,"",toTime);
      await axios({
          url:`${REACT_APP_SERVER_URL}/api/item/search-web?from_date=${date1} ${fromTime}&to_date=${date2} ${toTime}&city_id=${selectcity}&city_loc_id=${selectlocation}&cur_type=1&vehicle_type=0&brand_type=0`,
          method:"GET"
      }).then((response)=>{
          console.log(response.data,'data');
          setlist(response.data.Models)
      }).catch((err) => {
        if(err.request){ console.log(err.request) } if(err.response){ 
            console.log(err.response)
      
      }})
      await axios({
          url:`${REACT_APP_SERVER_URL}/api/web/maker/list`,
          method:"GET"
      }).then((response)=>{
          console.log(response.data,'brand');
          setmaker(response.data.cateDet)
      }).catch((err) => {
        if(err.request){ console.log(err.request) } if(err.response){ 
            console.log(err.response)
      
      }})
      await axios({
          url:`${REACT_APP_SERVER_URL}/api/web/category/list`,
          method:"GET"
      }).then((response)=>{
          console.log(response.data,'car type');
          setcategory(response.data.cateDet)
      }).catch((err) => {
        if(err.request){ console.log(err.request) } if(err.response){ 
            console.log(err.response)
      
      }})
  }
  const sortedProducts = [...list].sort((a, b) => {
    if (sortByLowToHigh) {
      return a.Offer_Rate - b.Offer_Rate;
    } else if (sortByHighToLow) {
      return b.Offer_Rate - a.Offer_Rate;
    } else {
      return list;
    }
  });
  console.log(

     startDate,'ajith'
  );
  return (
    <div>
        <Navbar/>
        <section>
      <div class="content_listing">
        <div class="container">
          <div class="row">

            <div class="search-edit">
              <div class="city_edit">
                <input type="text" name="" placeholder="Enter City"/>
              </div>
              <div class="date_time">
                {/* <input type="date" placeholder="Pickup Date"  name="dateInput" value="" required/> */}
                <DatePicker
                id="from-date"
                selected={startDate}
                onChange={handleFromDateChange}
                minDate={new Date()}
                startDate={startDate}
  selectsStart
  dateFormat="dd/MM/yyyy"
  className='form-control'
  required
/>
                <select name="ddlpickTime" id="ddlpickTime" class="time-box">
                  <option value="00:00">00:00</option>
                  <option value="00:30">00:30</option>
                  <option value="01:00">01:00</option>
                  <option value="01:30">01:30</option>
                  <option value="02:00">02:00</option>
                  <option value="02:30">02:30</option>
                </select>
              </div>
              <div class="date_time">
                {/* <input type="date" placeholder="Return Date"  name="dateInput" value="" required/> */}
                <DatePicker 
                selected={endDate} 
                onChange={handleToDateChange} 
                minDate={tomorrow}
                startDate={tomorrow}
                selectsEnd
                disabled={!tomorrow} 
                required/>
                <select name="ddlpickTime" id="ddlpickTime" class="time-box">
                  <option value="00:00">00:00</option>
                  <option value="00:30">00:30</option>
                  <option value="01:00">01:00</option>
                  <option value="01:30">01:30</option>
                  <option value="02:00">02:00</option>
                  <option value="02:30">02:30</option>
                </select>
              </div>
              <button>Search</button>
            </div>
          </div>
        </div>
        <div class="container">
          <div class="row">
            <div class="col-lg-3  col-md-3 col-sm-12 Listing_sidebar">
              <h3>Sort & Filters</h3>
              <div class="filter_block">
                <h4>Sort</h4>
                <ul>
                  <li>
                    <label>
                      <input type="radio" name="sort"/>
                      Featured
                    </label>
                    <label>
                      <input type="radio" name="sort"/>
                      Price - Low - High
                    </label>
                    <label>
                      <input type="radio" name="sort"/>
                      Price - High - Low
                    </label>
                  </li>
                </ul>
              </div>
              <div class="filter_block">
              
                <h4>Brand</h4>

                <select>
                  <option>Mercedes Benz</option>
                  <option>Mercedes Benz</option>
                  <option>Mercedes Benz</option>
                  <option>Mercedes Benz</option>
                </select>
                
              </div>
              <div class="filter_block">
                <h4>Car type</h4>
                <select>
                  <option>Mercedes Benz</option>
                  <option>Mercedes Benz</option>
                  <option>Mercedes Benz</option>
                  <option>Mercedes Benz</option>
                </select>
              </div>
            </div>
            <div class="col-lg-9  col-md-9 col-sm-12 Listing_block">
              <div class="sort-box">
                <div class="filter-phone">
                  Filter
                </div>
                <div class="search_edit_edit">
                  <i class="fas fa-search"></i>
                </div>
              </div>
              <div class="listing_flex">
                <div class="single_block">
                  <div class="image_block">
                    <img src="images/carlist.png"/>
                  </div>
                  <div class="detail_block">
                    <h2>renault symbol</h2>
                    <div class="specification">
                      <ul>
                        <li>
                          <img src="images/ac.png"/>
                          <span>Air Conditioner</span>
                        </li>
                        <li>
                          <img src="images/seat.png"/>
                          <span>Infotainment System</span>
                        </li>
                        <li>
                          <img src="images/seat.png"/>
                          <span>4 Seat</span>
                        </li>
                        <li>
                          <img src="images/manual.png"/>
                          <span>Manual</span>
                        </li>
                      </ul>
                    </div>
                    <div class="rate_details">
                      <div>
                        <span class="offer_p">QAR 385.00</span>
                        <span class="orig_p">QAR 400.00</span>
                        <p><b>QAR 400.00</b> / Day</p>
                        </div>
                        <div>
                          <button>Pay Now</button>
                        </div>
                      </div>
                    </div>
                  </div>
                  <div class="single_block">
                    <div class="image_block">
                      <img src="images/carlist.png"/>
                    </div>
                    <div class="detail_block">
                      <h2>renault symbol</h2>
                      <div class="specification">
                        <ul>
                          <li>
                            <img src="images/ac.png"/>
                            <span>Air Conditioner</span>
                          </li>
                          <li>
                            <img src="images/seat.png"/>
                            <span>Infotainment System</span>
                          </li>
                          <li>
                            <img src="images/seat.png"/>
                            <span>4 Seat</span>
                          </li>
                          <li>
                            <img src="images/manual.png"/>
                            <span>Manual</span>
                          </li>
                        </ul>
                      </div>
                      <div class="rate_details">
                        <div>
                          <span class="offer_p">QAR 385.00</span>
                          <span class="orig_p">QAR 400.00</span>
                          <p><b>QAR 400.00</b> / Day</p>
                          </div>
                          <div>
                            <button>Pay Now</button>
                          </div>
                        </div>
                      </div>
                    </div>
                    <div class="single_block">
                      <div class="image_block">
                        <img src="images/carlist.png"/>
                      </div>
                      <div class="detail_block">
                        <h2>renault symbol</h2>
                        <div class="specification">
                          <ul>
                            <li>
                              <img src="images/ac.png"/>
                              <span>Air Conditioner</span>
                            </li>
                            <li>
                              <img src="images/seat.png"/>
                              <span>Infotainment System</span>
                            </li>
                            <li>
                              <img src="images/seat.png"/>
                              <span>4 Seat</span>
                            </li>
                            <li>
                              <img src="images/manual.png"/>
                              <span>Manual</span>
                            </li>
                          </ul>
                        </div>
                        <div class="rate_details">
                          <div>
                            <span class="offer_p">QAR 385.00</span>
                            <span class="orig_p">QAR 400.00</span>
                            <p><b>QAR 400.00</b> / Day</p>
                            </div>
                            <div>
                              <button>Pay Now</button>
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                    
                  </div>
                </div>
              </div>
            </div>
            
          </section>
          <Footer/>
    </div>
  )
}

export default ListingPage
